import { configureStore } from '@reduxjs/toolkit';
import  tasksReducer  from './tasker';

export default configureStore({
    reducer:{
        tasks: tasksReducer
    },
    middleware: (getDefaultMiddleware) => getDefaultMiddleware({serializableCheck:false})
});
